import React, { Component } from "react";
import { CameraReels } from "react-bootstrap-icons";
import { Link } from "react-router-dom";
import { Button } from "react-bootstrap";
import axios from "axios";
import { GoogleLogin, GoogleLogout } from "react-google-login";
import { useDispatch } from "react-redux";

export default class NavBar extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  googleSuccess(res) {
    console.log("Sign In Success", res.profileObj);
  }

  googleFailure = (res) => {
    console.log("Sign In Failed", res);
  };

  render() {
    const user = null;

    return (
      <div>
        <header id="header" className="fixed-top">
          <div className="container d-flex align-items-center justify-content-between">
            <div className="d-flex flex-direction-row ">
              <CameraReels color="#123c69" size={40} />
              <Link to={"/"}>
                <h1 className="ml-3">Movies Collection</h1>
              </Link>

              <GoogleLogin
                clientId="374142562845-rrr3sqtq0c25ocgonbe25lebn4258gut.apps.googleusercontent.com"
                onSuccess={this.googleSuccess}
                onFailure={this.googleFailure}
                cookiePolicy="single_host_origin"
              />
              <GoogleLogout clientId="374142562845-rrr3sqtq0c25ocgonbe25lebn4258gut.apps.googleusercontent.com" />
            </div>
          </div>
        </header>
      </div>
    );
  }
}
